mapper.select:
select 

,

from TFSBILL_TEMP
where AMEND_OTHER_SL = #{AMEND_OTHER_SL}
  and BILL_NBR = #{BILL_NBR}
  and BILL_TYPE = #{BILL_TYPE}
  and BRANCH = #{BRANCH}
  and COMP_CODE = #{COMP_CODE}

mapper.delete:
delete from TFSBILL_TEMP
where AMEND_OTHER_SL = #{AMEND_OTHER_SL}
  and BILL_NBR = #{BILL_NBR}
  and BILL_TYPE = #{BILL_TYPE}
  and BRANCH = #{BRANCH}
  and COMP_CODE = #{COMP_CODE}
